import "./App.css";
import React, {useState} from "react";
import Umls from "./Umls";
import UmlItem from "./UmlItem";
import Userinput from "./Userinput";
const DUMMY_umls = [
    {
      id: "1",
      olduml:"jeep"
     
    },];
function App (){
   
    const [umllist, setUmllist] = useState(DUMMY_umls);
    const onAddumlDataHandle=(umllist)=>{
        setUmllist((prevUmllist)=>{
            return[umllist,...prevUmllist];
        });
    };
    function deleteTodo(id){
        this.setState((prevState) => ({
            Umllist: prevState.Umllist.filter(item => item.id !== id),
        }))
    }


    return(
       
        <div >
           <Userinput onAddumlData={onAddumlDataHandle}/>
           <Umls items={umllist} onDelete={this.deleteTodo}/>


        </div>
               
               
                
                
    );
};
export default App;
